import React from 'react'



class TestComponent extends React.Component {
  render(){
    return(
      <React.Fragment>

          <img style="width:300px;" className={this.props.photoClick} src="https://i.pinimg.com/236x/0a/3f/c6/0a3fc6f63f0fb890f544035bced4ad55--sponge-bob-classic-cartoons.jpg" alt="sandy"></img>

      </React.Fragment>
    )
  }
}

export default TestComponent
